  const [value, setValue] = React.useState("");
  return (
    <form>
      <input type="text" onChange={(event) => setValue(event.target.value)} />
      <input
        type="submit"
        value="Submit"
        onClick={() => setTodos(todos + { name: value })}
      />
    </form>
  );
}
